(135, NULL, NULL, '16-Bjorn-Lomborg-Dont-waste-trillions-on-BAD-Climate-Policy.mp4', 'video', '16-Bjorn-Lomborg-Dont-waste-trillions-on-BAD-Climate-Policy.mp4', 'Bjorn Lomborg | Don\'t waste trillions on BAD Climate Policy', '81 min lecture on the impact of climate change policies', NULL);
INSERT INTO `resources_extended` (`id`, `title`, `copy`, `type`, `link_web`, `path`, `uuid`, `political`, `belief`, `form`, `content`) VALUES
(1, 'Climate Change Will Cost Us Even More Than We Think', 'Economists greatly underestimate the price tag on harsher weather and higher seas. Why is that?', 'text', 'https://www.nytimes.com/2019/10/23/opinion/climate-change-costs.html', '1_SS_Climate_Change-The_New_York_Times.pdf', '1_SS_Climate_Change-The_New_York_Times.pdf', 'progressive', 'opinion', 'Simple', 'Simple'),
(2, 'Satellites show world’s glaciers melting faster than ever', 'Glaciers are melting faster, losing 31 percent more snow and ice per year than they did 15 years earlier, according to three-dimensional satellite measurements of all the world’s mountain glaciers.', 'text', 'https://nypost.com/2021/04/29/satellites-show-worlds-glaciers-melting-faster-than-ever/', '3_SS_glaciers_melting_faster_than_ever.pdf', '3_SS_glaciers_melting_faster_than_ever.pdf', 'progressive', 'fact', 'Simple', 'Simple'),
(3, 'The world wasted nearly 1 billion metric tons of food in 2019', 'The world wasted about 931 million metric tons of food in 2019 — an average of 121 kilograms per person. That’s about 17 percent of all food that was available to consumers that year, a new United Nations report estimates.', 'text', 'https://www.sciencenews.org/article/food-waste-climate-world-united-nations-1-billion-metric-tons-2019', '20_MS_The_world_wasted_food.pdf', '20_MS_The_world_wasted_food.pdf', 'progressive', 'fact', 'Medium', 'Simple'),
(4, 'Global energy growth is outpacing decarbonization', 'Recent reports have highlighted the challenge of keeping global average temperatures below 2 °C and - even more so -1.5 °C (IPCC 2018). Fossil-fuel burning and cement production release∼90% of all\r\nCO2 emissions from human activities.', 'text', 'https://iopscience.iop.org/article/10.1088/1748-9326/aaf303/pdf', '32_CS_Global_energy_growth_outpacing_decarobanization.pdf', '32_CS_Global_energy_growth_outpacing_decarobanization.pdf', 'progressive', 'fact', 'Complex', 'Simple'),
(5, 'We need IMMEDIATE action to stop extinction crisis, David Attenborough - BBC', '6 min (BBC) video on why we need to change our lifestyles to prevent mass animal extinction', 'video', 'https://www.youtube.com/watch?v=dbCR0KSU52g', '14-David-Attenborough-We-need-IMMEDIATE-action-to-stop-extinction-crisis-BBC.mp4', '14-David-Attenborough-We-need-IMMEDIATE-action-to-stop-extinction-crisis-BBC.mp4', 'progressive', 'belief', 'Simple', 'Simple'),
(6, 'Climate Change - by Chris Riedy', 'In the period since the Industrial Revolution, human emissions of greenhouse gases from fossil fuel combustion, deforestation and agricultural practices have led to global warming and climate change.', 'text', 'https://www.researchgate.net/publication/311301385_Climate_Change', '33_CS_Climatechange.pdf', '33_CS_Climatechange.pdf', 'progressive', 'fact', 'Complex', 'Simple'),
(7, 'Special Issue Introduction: Adding insult to injury: Climate change and theinequities of climate intervention', 'Climate change is redistribution. It alters the timing and intensityof our rains and winds, the humidity in our soils, and the sea levelaround us', 'text', 'https://www.sciencedirect.com/science/article/pii/S0959378012000258', '34_CS_Climate_change_and_intervention.pdf', '34_CS_Climate_change_and_intervention.pdf', 'progressive', 'fact', 'Complex', 'Simple'),
(8, 'Introduction: Consequences of Global Warming to Planetary and Human Health', 'Global warming occurs from anthropogenic fossil-fuel burning, increasing greenhouse gases and causing Earth’s mean surface temperature to rise.', 'text', 'https://link.springer.com/chapter/10.1007/978-3-030-54746-2_1', '35_CS_Introduction_Consequences_of_Global_Warming.pdf', '35_CS_Introduction_Consequences_of_Global_Warming.pdf', 'progressive', 'fact', 'Complex', 'Simple'),
(9, 'A spike in Arctic lightning strikes may be linked to climate change', 'Arctic lightning has gotten way more frequent over the last decade amid rising global temperatures, study finds', 'text', 'https://www.sciencenews.org/article/arctic-lightning-climate-change-global-warming', '17_MS_A_spike_in_Arctic_lightning_strikes.pdf', '17_MS_A_spike_in_Arctic_lightning_strikes.pdf', 'center', 'fact', 'Medium', 'Simple'),
(10, 'NASA: Global Warming', 'Throughout its long history, Earth has warmed and cooled time and again. Climate has changed when the planet received more or less sunlight due to subtle shifts in its orbit, as the atmosphere or surface changed, or when the Sun’s energy varied. But in the past century, another force has started to influence Earth’s climate: humanity.', 'text', 'https://earthobservatory.nasa.gov/features/GlobalWarming', '18_MS_Global_Warming_nasa.pdf', '18_MS_Global_Warming_nasa.pdf', 'center', 'fact', 'Medium', 'Simple'),
(11, 'Did the Drop in COVID-Related Emissions Affect the Climate?', 'Global emissions dropped markedly in 2020, due in large part to lockdowns that slowed economic and social activity, but the climate likely won’t be noticeably affected.', 'text', 'https://eos.org/research-spotlights/did-the-drop-in-covid-related-emissions-affect-the-climate', '19_MS_COVID-Related_Emissions_Affect_the_Climate.pdf', '19_MS_COVID-Related_Emissions_Affect_the_Climate.pdf', 'center', 'fact', 'Medium', 'Simple'),
(12, 'What does Trump actually believe on climate change?', 'US President Donald Trump\'s position on climate change has been in the spotlight again, after he criticised \"prophets of doom\" at the World Economic Forum in Davos.', 'text', 'https://www.bbc.com/news/world-us-canada-51213003', '2_SS_Trump_on_climate_change_BBC_News.pdf', '2_SS_Trump_on_climate_change_BBC_News.pdf', 'conservative', 'fact', 'Simple', 'Simple'),
(13, 'Global warming is a problem, but so are climate doomsayers', 'OPINION. Bjorn Lomborg, a visiting professor at the Copenhagen Business School. Most people on the planet wake up each day thinking that things are getting worse. It is little wonder, given what they routinely read in the newspaper or see on television. But this gloomy mood is a problem, because it feeds into scare stories about how climate change will end in Armageddon.', 'text', 'https://www.theglobeandmail.com/opinion/article-global-warming-is-a-problem-but-so-are-climate-doomsayers/', '4_SS_climate_doomsayers.pdf', '4_SS_climate_doomsayers.pdf', 'conservative', 'opinion', 'Simple', 'Simple'),
(14, 'Don’t mess with Mother Earth. Climate change is a hoax | Letter to the editor', 'Rising sea levels? Well, it has not happened yet, but hey some scientists say it might or it will in the future. I personally doubt it and I believe all this doom and gloom about global warming or, when the climate does not fit the narrative, it is called climate change, is a big money making hoax.', 'text', 'https://www.bradenton.com/latest-news/article237480339.html', '5_SS_Climate_change_is_a_hoax.pdf', '5_SS_Climate_change_is_a_hoax.pdf', 'conservative', 'opinion', 'Simple', 'Simple'),
(15, 'Man-made climate change does not exist', 'Piers Corbyn argues that Man-made Global Warming caused by CO1 is \"nonsense\". Instead, he argues that \"In the long run CO2 levels are an EFFECT NOT A CAUSE of changes in Climate / temperatures,\" and that it is the sun that drives climate.', 'text', '*OvationPro (bundestag.de)', '31_CS_Man-Made_Climate_does_not_exist.pdf', '31_CS_Man-Made_Climate_does_not_exist.pdf', 'conservative', 'fact', 'Complex', 'Simple'),
(16, 'Costing the Earth: Fields Paved with Gold', 'Solar panels could be the latest get rich quick scheme for landowners. Or they could leave many investors out of pocket. Tom Heap asks if this solar gold rush is sustainable.', 'audio', 'https://www.bbc.co.uk/sounds/play/b0100grj', 'CostingTheEarth-20110406-FieldsPavedWithGold.mp3', 'CostingTheEarth-20110406-FieldsPavedWithGold.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(17, 'Climate Grant Universities Could Mobilize Community Climate Action', 'With cues from the successful land grant model, the United States should establish a system of universities to democratize access to climate knowledge and aid efforts to tackle the climate crisis.', 'text', 'https://eos.org/opinions/climate-grant-universities-could-mobilize-community-climate-action', '23_MM_Mobilize_Community_Climate_Action.pdf', '23_MM_Mobilize_Community_Climate_Action.pdf', 'progressive', 'opinion', 'Medium', 'Medium'),
(18, 'Costing the Earth: How to Halve Emissions by 2030', 'Ahead of the crucial COP26 climate conference in November, experts chart the route to halving global GHG emissions by 2030.', 'audio', 'https://www.bbc.co.uk/sounds/play/m000sqlc', 'CostingTheEarth-20210302-HowToHalveEmissionsBy2030.mp3', 'CostingTheEarth-20210302-HowToHalveEmissionsBy2030.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(19, 'Costing the Earth: Zero Carbon Britain', 'The UK is one of the few advanced economies to commit to the idea of net zero carbon emissions by 2050. Tom Heap asks if we can achieve our ambitious goal.', 'audio', 'https://www.bbc.co.uk/sounds/play/m000hmgs', 'CostingTheEarth-20200428-ZeroCarbonBritain.mp3', 'CostingTheEarth-20200428-ZeroCarbonBritain.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(20, 'When Does Weather Become Climate?', 'Flexible definitions of the word “climate” may impede policy discussions on climate change. Closing apparent gaps between “climate” and “weather” may help reduce the ambiguity.', 'text', 'https://eos.org/opinions/when-does-weather-become-climate', '24_MM_When_Does_Weather_Become_Climate.pdf', '24_MM_When_Does_Weather_Become_Climate.pdf', 'progressive', 'opinion', 'Medium', 'Medium'),
(21, 'Climate Change Is Not Our Fault', 'It\'s time to change the way we talk about climate change.\r\n\r\nPolitical leaders have acknowledged human-driven (or \"anthropogenic\") global warming since 1964 (when President Lyndon Johnson mentioned it in a speech to Congress). Since then, however, we\'ve done almost nothing to address its dangers.', 'audio', 'https://www.npr.org/sections/13.7/2015/10/06/446109168/climate-change-is-not-our-fault', 'Climate-Change-Is-Not-Our-Fault.mp3', 'Climate-Change-Is-Not-Our-Fault.mp3', 'progressive', 'opinion', 'Simple', 'Simple'),
(22, 'How to Save a Planet - Presenting: Science Vs', 'We know that carbon dioxide is rising and we know that it’s warming the world, but how did scientists figure that out in the first place? And what will all this warming mean for our future? Our friends at the Gimlet podcast, Science Vs., visited a couple climate scientists to find out.', 'audio', 'https://www.iheart.com/podcast/309-how-to-save-a-planet-69407972/', 'How-to-Save-a-Planet-Presenting-Science-Vs.mp3', 'How-to-Save-a-Planet-Presenting-Science-Vs.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(23, 'Generation Green New Deal - Where Have Adults Been?', 'Amy Westervelt of the DrillIed podcast co-hosts this episode as we delve into the question of why it\'s taken so much time, and a movement led by teenagers and 20-somethings, to push politicians to get serious about climate action.', 'audio', 'https://www.generationgreennewdeal.com/podcast-s1e4', 'GenerationGreenNew-Deal-S1-Ep4.mp3', 'GenerationGreenNew-Deal-S1-Ep4.mp3', 'progressive', 'opinion', 'Medium', 'Simple'),
(24, 'Climate Change: What Happens If The World Warms Up By 2°C?', '2 min (skynews) animation about the possible effects of a temperature increase of 2 degrees celsius', 'video', 'https://www.youtube.com/watch?v=9GjrS8QbHmY', '7-Climate-Change_What-Happens-If-The-World-Warms-Up-By-2c_.mp4', '7-Climate-Change_What-Happens-If-The-World-Warms-Up-By-2c_.mp4', 'center', 'fact', 'Simple', 'Medium'),
(25, 'DON\'T PANIC — Hans Rosling showing the facts about population', '58 min lecture by hans rosling about the distribution of population and population growth', 'video', 'https://www.youtube.com/watch?v=FACK2knC08E', '41-DONT-PANIC-Hans-Rosling-showing-the-facts-about-population.mp4', '41-DONT-PANIC-Hans-Rosling-showing-the-facts-about-population.mp4', 'center', 'fact', 'Medium', 'Medium'),
(26, 'Factcheck: Lord Lawson’s inaccurate claims about climate change on BBC Radio 4', 'The Today programme, BBC Radio 4’s flagship current affairs breakfast show, featured a prominent five-minute interview this morning with the climate sceptic Conservative peer Lord Lawson.', 'audio', 'https://www.carbonbrief.org/factcheck-lord-lawson-inaccurate-claims-about-climate-change-bbc-radio-four', 'Lord-Lawson-discusses-Al-Gores-new-film-An-Inconvenient-Sequel-on-BBC-Radio-4.mp3', 'Lord-Lawson-discusses-Al-Gores-new-film-An-Inconvenient-Sequel-on-BBC-Radio-4.mp3', 'conservative', 'opinion', 'Medium', 'Simple'),
(27, 'Triggered - CNN\'s Climate Propaganda Night', 'Last night was CNN\'s climate propaganda night. The top 10 Democratic candidates headed into an echo chamber to discuss their radical climate change policies. Matt and Storm discuss.', 'audio', 'https://www.podchaser.com/podcasts/triggered-711069/episodes/114-cnns-climate-propaganda-ni-44427874', 'triggered-e114.mp3', 'triggered-e114.mp3', 'conservative', 'opinion', 'Complex', 'Simple'),
(28, 'Triggered - President Trump at the UN, The Climate Cult, Ukraine Whistleblower Lie', 'Storm and Matt are back on this tremendous Tuesday. The guys cover some of the best parts of President Trump\'s speech at the United Nations, the climate cultists and their big government, socialist agenda, and the latest in the Ukraine whistleblower story that has House Democrats once again considering impeachment.', 'audio', 'https://www.podchaser.com/podcasts/triggered-711069/episodes/114-cnns-climate-propaganda-ni-44427874', 'triggered-e120.mp3', 'triggered-e120.mp3', 'conservative', 'opinion', 'Complex', 'Simple'),
(29, 'Rush Limbaugh Feb 26, 2021', 'Folks, you remember that sad video of that starving polar bear, national geographic posted it last December with a caption this is what climate change looks like.', 'audio', 'https://www.podchaser.com/podcasts/rush-limbaugh-morning-update-219075/episodes/rush-limbaugh-feb-26-2021-85435942', 'HSW4585389429.mp3', 'HSW4585389429.mp3', 'conservative', 'fact', 'Simple', 'Simple'),
(30, 'Rush Limbaugh Sep 15, 2020', 'AP reports that the West Coast fires, which have killed at least 35 people, have raised the fight over climate change conservative before Trump visits.', 'audio', 'https://www.podchaser.com/podcasts/rush-limbaugh-morning-update-219075/episodes/rush-limbaugh-sep-15-2020-74599594', 'HSW7474487221.mp3', 'HSW7474487221.mp3', 'conservative', 'opinion', 'Simple', 'Simple'),
(31, 'Inherited - The Green New Dream', 'Listen, 2020 has been rough. Between the pandemic, climate fires, police brutality, and the election, this year has felt like we’re hurtling down a highway to hell. But today, we’re taking an exit.', 'audio', 'https://castbox.fm/episode/The-Green-New-Dream-id3079766-id313147273?country=us', 'ADL3830736491.mp3', 'ADL3830736491.mp3', 'progressive', 'opinion', 'Complex', 'Simple'),
(32, 'The beautiful future of solar power | Marjan van Aubel', '8 min (TED) talk on design possibilities for solar cells', 'video', 'https://www.youtube.com/watch?v=_lyP_2p5MJc', '11-The-beautiful-future-of-solar-power-_-Marjan-van-Aubel.mp4', '11-The-beautiful-future-of-solar-power-_-Marjan-van-Aubel.mp4', 'progressive', 'belief', 'Medium', 'Simple'),
(33, 'Generation Green New Deal - Now What?? Climate in the Biden Administration', 'We’re now more than a month removed from the 2020 elections, and a little more than a month away from President-Elect Joe Biden and Vice President-Elect Kamala Harris officially taking office...So, what do we know about their plans for tackling the climate crisis?', 'audio', 'https://www.generationgreennewdeal.com/podcast-s1e7', 'generationgreennewdeal-s1e7.mp3', 'generationgreennewdeal-s1e7.mp3', 'progressive', 'opinion', 'Medium', 'Simple'),
(34, 'Vietnam: Climate change threatens rice production', '4 min (UN) report on the effects of climate change on rice production in Vietnam farmlands', 'video', 'https://www.youtube.com/watch?v=1K2MogaZb6s', '29.Vietnam_Climate-change-threatens-rice-production.mp4', '29.Vietnam_Climate-change-threatens-rice-production.mp4', 'progressive', 'belief', 'Medium', 'Simple'),
(35, 'Living Planet: Unexpected ideas', 'On this week\'s show, Spain grapples with the environmental impact of the renewable energy boom. Young entrepreneurs in Kenya discover how a tiny critter can make a big impact on food waste. And Mexico takes the lead in kicking the herbicide glyphosate to the curb for the sake of its native bees.', 'audio', 'https://www.dw.com/en/living-planet-unexpected-ideas/av-57508978', 'living-planet-unexpected-ideas.mp3', 'living-planet-unexpected-ideas.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(36, 'Living Planet: Water wars', 'In the Global North, clean water is taken for granted — but in some places it means the difference between life and death. \"Water wars\" are taking place as people fight failing systems, and combat climate change, to access enough clean water for all.', 'audio', 'https://www.dw.com/en/living-planet-water-wars/av-56995360', 'living-planet-water-wars.mp3', 'living-planet-water-wars.mp3', 'progressive', 'fact', 'Simple', 'Simple'),
(37, 'The New Face Of Climate Change — The Climate Migrant', '4 min (VICE) report on potential climate refugees/migrants in mexico', 'video', 'https://www.youtube.com/watch?v=UDlHcxWtbvw', '19-The-New-Face-Of-Climate-ChangeThe-Climate-Migrant.mp4', '19-The-New-Face-Of-Climate-ChangeThe-Climate-Migrant.mp4', 'progressive', 'belief', 'Complex', 'Simple'),
(38, 'Greta Thunberg to world leaders: \'How dare you? You have stolen my dreams and my childhood\'', '4 min speech of greta thunberg at 2019 UN climate summit', 'video', 'https://www.youtube.com/watch?v=TMrtLsQbaok', '38-Greta-Thunberg-to-world-leaders-How-dare-you-You-have-stole-my-dreams-and-my-childhood.mp4', '38-Greta-Thunberg-to-world-leaders-How-dare-you-You-have-stole-my-dreams-and-my-childhood.mp4', 'progressive', 'belief', 'Medium', 'Simple'),
(39, 'Under-reporting of greenhouse gas emissions\r\nin U.S. cities', 'Cities dominate greenhouse gas emissions. Many have generated self-reported emission\r\ninventories, but their value to emissions mitigation depends on their accuracy, which remains\r\nuntested.', 'text', 'https://www.nature.com/articles/s41467-020-20871-0.pdf', '39_CM_Under-reporting_of_greenhouse_gas.pdf', '39_CM_Under-reporting_of_greenhouse_gas.pdf', 'progressive', 'fact', 'Complex', 'Medium'),
(40, 'Why Egypt\'s lifeline is drying up | Nile Conflict', '8 min video report on Egypt and how the Nile is drying up, causing problems', 'video', 'https://www.youtube.com/watch?v=WKCW5Gg6Ffo', '24-Why-Egypts-lifeline-is-drying-up-Nile-Conflict.mp4', '24-Why-Egypts-lifeline-is-drying-up-Nile-Conflict.mp4', 'center', 'belief', 'Simple', 'Simple'),
(41, 'The basics of Global Warming', 'The Sun serves as the primary energy source for Earth’s climate. Some of the incoming sunlight is reflected directly back into space, especially by bconservative surfaces such as ice and clouds, and the rest is absorbed by the surface and the atmosphere.', 'text', 'https://www.nap.edu/read/25733/chapter/5', '16_MS_The_Basics_of_Climate_Change.pdf', '16_MS_The_Basics_of_Climate_Change.pdf', 'center', 'fact', 'Medium', 'Simple'),
(42, 'What Greta Thunberg does not understand about climate change | Jordan Peterson', '7 min speech in reaction to speech of greta thunberg by jordan peterson', 'video', 'https://www.youtube.com/watch?v=y564PsKvNZs', '39-What-Greta-Thunberg-does-not-understand-about-climate-change-Jordan-Peterson.mp4', '39-What-Greta-Thunberg-does-not-understand-about-climate-change-Jordan-Peterson.mp4', 'conservative', 'belief', 'Complex', 'Simple'),
(43, 'Do 97% of scientists actually agree on climate change?', '3 min (OAN) interview with climate change skeptics, arguing that not all scientists argee and that consensus may not be correct', 'video', 'https://www.youtube.com/watch?v=wN3tGVOS06A', '6-Do-97-of-scientists-actually-agree-on-climate-change.mp4', '6-Do-97-of-scientists-actually-agree-on-climate-change.mp4', 'conservative', 'belief', 'Medium', 'Simple'),
(44, 'Rush Limbaugh Jan 22, 2021', 'The progressive is gleeful, shortly after being install Joe Biden signed executive order putting us back in the Paris climate agreement.', 'audio', 'https://www.podchaser.com/podcasts/rush-limbaugh-morning-update-219075/episodes/rush-limbaugh-jan-22-2021-83153556', 'HSW4795812571.mp3', 'HSW4795812571.mp3', 'conservative', 'opinion', 'Simple', 'Simple'),
(45, 'Climate Change: What Do Scientists Say?', '5 min (PragerU) video of a climate skeptic scientist giving his views on the debate of climate change', 'video', 'https://www.youtube.com/watch?v=OwqIy8Ikv-c', '4-Climate-Change_What-Do-Scientists-Say_.mp4', '4-Climate-Change_What-Do-Scientists-Say_.mp4', 'conservative', 'fact', 'Simple', 'Simple'),
(46, 'Population growth and climate change explained by Hans Rosling', '3 min instruction of how population and carbon emissions are distributed across countries', 'video', 'https://www.youtube.com/watch?v=SxbprYyjyyU', '40-Population-growth-and-climate-change-explained-by-Hans-Rosling.mp4', '40-Population-growth-and-climate-change-explained-by-Hans-Rosling.mp4', 'progressive', 'belief', 'Simple', 'Simple'),
(47, 'Delivering success at the Leaders’ Summit on Climate', 'The summit could stoke a collective sense that finally – after decades of negotiations – this is the pivotal year for climate. The US is back at the climate table, and the Biden-Harris Administration is making climate action a center organising principle of its government.', 'text', 'https://www.eco-business.com/opinion/delivering-success-at-the-leaders-summit-on-climate/', '7_SM_Leaders_Summit_on_Climate.pdf', '7_SM_Leaders_Summit_on_Climate.pdf', 'progressive', 'opinion', 'Simple', 'Medium'),
(48, 'Opinion: Climate change is threatening our circulation. We must act now.', 'THE WORLD’S climate depends on a global aquatic “conveyor belt” system that snakes around the oceans, taking heat from some places and redistributing it elsewhere. It is this system that keeps Europe relatively warm despite its northern latitudes, underpins major fisheries and drives key weather patterns across continents.', 'text', 'https://www.washingtonpost.com/opinions/global-warming-is-endangering-more-than-we-think-we-must-adjust/2021/03/26/1a963fc0-77cc-11eb-8115-9ad5e9c02117_story.html', '8_SM_Climate_change_circulation.pdf', '8_SM_Climate_change_circulation.pdf', 'progressive', 'opinion', 'Simple', 'Medium'),
(49, 'How to Save Our Planet', '8 min (WWF) video essay arguing that biodiversity is essential to create a stable climate for humans', 'video', 'https://www.youtube.com/watch?v=0Puv0Pss33M', '44-How-to-Save-Our-Planet.mp4', '44-How-to-Save-Our-Planet.mp4', 'progressive', 'belief', 'Medium', 'Simple'),
(50, 'Only intact forests can stave off climate change', 'The world’s forests are supposed to stave off climate change. progressive alone, perhaps they could. But they’re not being progressive alone.', 'text', 'https://www.eco-business.com/news/only-intact-forests-can-stave-off-climate-change/', '9_SM_Only_intact_forests_can_stave_off.pdf', '9_SM_Only_intact_forests_can_stave_off.pdf', 'progressive', 'fact', 'Simple', 'Medium'),
(51, 'The Climate Change Deniers in Congress', 'What would you think if your government didn\'t believe in gravity? If your senator alleged that, because they couldn\'t see it, perhaps it didn\'t exist. To many, this might seem absurd—the science is enough to know that it\'s real.', 'text', 'https://www.vice.com/en/article/pg5zqg/a-guide-to-the-climate-change-deniers-in-congress', '10_SM_The_Climate_Change_Deniers_in_Congress.pdf', '10_SM_The_Climate_Change_Deniers_in_Congress.pdf', 'progressive', 'fact', 'Simple', 'Medium'),
(52, 'Leonardo DiCaprio (UN Messenger of Peace) at the opening of Climate Summit 2014', '4 min (UN) speech by Leonardo DiCaprio arguing that the climate crisis is urgent and must be adressed', 'video', 'https://www.youtube.com/watch?v=vTyLSr_VCcg', '43-Leonardo-DiCaprio-UN-Messenger-of-Peace-at-the-opening-of-Climate-Summit-2014.mp4', '43-Leonardo-DiCaprio-UN-Messenger-of-Peace-at-the-opening-of-Climate-Summit-2014.mp4', 'progressive', 'belief', 'Complex', 'Simple'),
(53, 'Why clouds are the missing piece in the climate change puzzle', 'How much our world will warm this century depends on the actions we take in coming decades. In order to keep global temperature rise below 1.5°C and avoid dangerous levels of warming, governments need to know how much carbon they can emit, and over what timeframe.', 'text', 'https://theconversation.com/why-clouds-are-the-missing-piece-in-the-climate-change-puzzle-140812', '22_MM_Why_clouds_are_the_missing_piece.pdf', '22_MM_Why_clouds_are_the_missing_piece.pdf', 'progressive', 'fact', 'Medium', 'Medium'),
(54, 'The Arctic\'s greening, but it won\'t save us', 'New research suggests that new green biomass in the Arctic is not as large a carbon sink as scientists had hoped.', 'text', 'https://www.sciencedaily.com/releases/2021/04/210429112330.htm', '21_MM_The_Arctic_greening.pdf', '21_MM_The_Arctic_greening.pdf', 'center', 'fact', 'Medium', 'Medium'),
(55, 'Land Ecosystems Are Becoming Less Efficient at Absorbing Carbon Dioxide', 'Plants play a key role in mitigating climate change. The more carbon dioxide they absorb during photosynthesis, the less carbon dioxide remains trapped in the atmosphere, where it can cause temperatures to rise.', 'text', 'https://climate.nasa.gov/news/3057/land-ecosystems-are-becoming-less-efficient-at-absorbing-carbon-dioxide/', '25_MM_Less_Efficient_at_Absorbing_Carbon_Dioxide.pdf', '25_MM_Less_Efficient_at_Absorbing_Carbon_Dioxide.pdf', 'center', 'fact', 'Medium', 'Medium'),
(56, 'Our Forests | Timelapse in Google Earth', '3 min sattelite  timelapses of deforestation across the globe', 'video', 'https://www.youtube.com/watch?v=b4eLTYUcj7k', '28-Our-Forests-Timelapse-in-Google-Earth.mp4', '28-Our-Forests-Timelapse-in-Google-Earth.mp4', 'center', 'fact', 'Simple', 'Simple'),
(57, 'Environmentalist explains why renewable energy can\'t save the planet', '4 min (FOX) interview with a environmental scientist about advantages of nuclear energy', 'video', 'https://www.youtube.com/watch?v=5v8ZPil4wbs', '45-Environmentalist-explains-why-renewable-energy-cant-save-the-planet.mp4', '45-Environmentalist-explains-why-renewable-energy-cant-save-the-planet.mp4', 'conservative', 'fact', 'Complex', 'Simple'),
(58, 'Exposing Washington: Man-made climate change is a hoax', 'We will discuss how CNN is pushing the climate change hoax on the American people.', 'audio', 'https://afr.net/podcasts/exposing-washington/2019/december/best-of-exposing-washington-man-made-climate-change-is-a-hoax/', 'EXPOSING-WASHINGTON-MAN-MADE-CLIMATE-CHANGE-IS-A-HOAX.mp3', 'EXPOSING-WASHINGTON-MAN-MADE-CLIMATE-CHANGE-IS-A-HOAX.mp3', 'conservative', 'opinion', 'Medium', 'Simple'),
(59, 'Mark Levin Podcast', 'The Mark Levin Podcast about climate change and why climate change is something made up of scientists. The traditional media uses this to push the demogratic party', 'audio', 'https://cms.megaphone.fm/channel/mark-levin-podcast?selected=WWO7374924433', 'mark-levin-podcast-climate-change.mp3', 'mark-levin-podcast-climate-change.mp3', 'conservative', 'opinion', 'Complex', 'Simple'),
(60, 'Why some detractors say Earth is not in crisis, and why that drives most climate scientists crazy', 'Utah author Bill Pekny wrote a book with 13 chapters describing climate change, full of charts, colorful graphics and “key takeaways” after each segment in which he impresses upon his readers why his research matters, and should offer comfort to those who believe the world is on the eve of destruction.', 'text', 'https://www.deseret.com/utah/2021/4/15/22260474/climate-change-debate-some-detractors-say-earth-not-in-crisis-politics-anthropogenic-global-warming', '6_SM_detractors_say_Earth_is_not_in_crisis.pdf', '6_SM_detractors_say_Earth_is_not_in_crisis.pdf', 'conservative', 'fact', 'Simple', 'Medium'),
(61, 'Hot Take: 2018: The Wake-Up Call', '2018 brought massive change to the ways we talk about climate. Global climate scientists put out the most alarming report yet on climate change impacts and projections, and media covered that report with the seriousness it deserved.', 'audio', 'https://podbay.fm/p/1488414960/e/1576826703', 'hot-take-the-wake-up-call.mp3', 'hot-take-the-wake-up-call.mp3', 'progressive', 'fact', 'Medium', 'Medium'),
(62, 'Costing the Earth: Waters of Arabia', 'Arabic engineers once made Yemen a fertile oasis. Today it is in imminent danger of running out of water. Leana Hosea reports on efforts to avert a crisis.', 'audio', 'https://www.bbc.co.uk/programmes/b0151pyv', 'CostingTheEarth-20110928-WatersOfArabia.mp3', 'CostingTheEarth-20110928-WatersOfArabia.mp3', 'progressive', 'fact', 'Medium', 'Medium'),
(63, 'TIL what Americans think about climate change', 'Surveys show that both progressive- and conservative-leaning Americans support policies that slow climate change. So why aren’t we seeing more of these policies pass as legislation?', 'audio', 'https://climate.mit.edu/podcasts/e1-til-what-americans-think-about-climate-change', 'til-what-americans-think-about-climate-change.mp3', 'til-what-americans-think-about-climate-change.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(64, 'TIL about carbon capture', 'This season, we’ve talked about alternative energy sources that don’t emit carbon dioxide -- but what if there was a way to continue using fossil fuels for energy without emitting CO2 into the atmosphere?', 'audio', 'https://climate.mit.edu/podcasts/e7-til-about-carbon-capture', 'til-about-carbon-capture_tc.mp3', 'til-about-carbon-capture_tc.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(65, 'TIL about climate impacts', 'With climate change, some parts of the world will get more water, but others will experience droughts. Some will start seeing more mosquitoes, but some fewer. And some regions might actually benefit economically. What’s the deal?', 'audio', 'https://climate.mit.edu/podcasts/e6-til-about-climate-impacts', 'TIL_about_climate_impacts_tc.mp3', 'TIL_about_climate_impacts_tc.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(66, 'A Matter of Degree - Cleaning Up the Carbon Mess', 'Can we go from doing “less bad” to actually removing carbon dioxide from the atmosphere?', 'audio', 'https://www.degreespod.com/episodes/episode-06', 'degreespod-Cleaning-Up-the-Carbon-Mess-.mp3', 'degreespod-Cleaning-Up-the-Carbon-Mess-.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(67, 'A Matter of Degree - Cleaning Up the Carbon Mess', 'Climate change is no longer a far-off scenario. It’s happening now. It’s getting more intense every year. And young people are seeing a scary future play out conservative in front of them.', 'audio', 'https://www.degreespod.com/episodes/episode-02', 'degreespod-a-breakthrough-moment-.mp3', 'degreespod-a-breakthrough-moment-.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(68, 'Why It\'s Hard To Change Minds About Climate Change', 'Over the weekend, Lesley Stahl of \"60 Minutes\" interviewed President Trump about a variety of issues, including climate change:', 'audio', 'https://www.npr.org/2018/10/16/657907123/why-its-hard-to-change-minds-about-climate-change', 'npr-Why-Its-Hard-To-Change-Minds-About-Climate-Change.mp3', 'npr-Why-Its-Hard-To-Change-Minds-About-Climate-Change.mp3', 'progressive', 'fact', 'Medium', 'Medium'),
(69, 'The deep ocean under climate change', 'The deep ocean absorbs vast amounts of heat and carbon dioxide, providing a critical buffer to climate change but exposing vulnerable ecosystems to combined stresses of warming, ocean acidification, deoxygenation, and altered food inputs. Resulting changes may threaten biodiversity and compromise key ocean services that maintain a healthy planet and human livelihoods', 'text', 'https://science.sciencemag.org/content/350/6262/766/tab-pdf', '38_CM_The_deep_ocean_under_climate_change.pdf', '38_CM_The_deep_ocean_under_climate_change.pdf', 'center', 'fact', 'Complex', 'Medium'),
(70, 'Seasonality, Intensity, and Duration of Rainfall Extremes Change in a Warmer Climate', 'Precipitation extremes are expected to intensify under climate change with consequent impacts in flooding and ecosystem functioning. Here we use station data and high-resolution simulations from the WRF convection permitting climate model over the US to assess future changes in hourly precipitation extremes', 'text', 'https://agupubs.onlinelibrary.wiley.com/doi/epdf/10.1029/2020EF001824', '43_CC_Rainfall_Extremes_Change_in_a_Warmer_Climate.pdf', '43_CC_Rainfall_Extremes_Change_in_a_Warmer_Climate.pdf', 'center', 'fact', 'Complex', 'Complex'),
(71, 'Last glacial atmospheric CO2 decline due to widespread Pacific deep-water expansion', 'Ocean circulation critically affects the global climate and atmospheric carbon dioxide through redistribution of heat and carbon in the Earth system.', 'text', 'https://www.nature.com/articles/s41561-020-0610-5.pdf?origin=ppub', '45_CC_Glacial_CO2.pdf', '45_CC_Glacial_CO2.pdf', 'center', 'fact', 'Complex', 'Complex'),
(72, 'Is Climate Change an Existential Threat?', '7 min (PragerU) animated video debunking the fact that fossil fuels are an existential threat to human life (+recommendation of nuclear energy)', 'video', 'https://www.youtube.com/watch?v=f5nUO7EYnUk', '13-IsClimate-Change-an-Existential-Threat_.mp4', '13-IsClimate-Change-an-Existential-Threat_.mp4', 'conservative', 'fact', 'Simple', 'Complex'),
(73, 'Can Climate Models Predict Climate Change?', '5 min animation on why climate change models fail to work', 'video', 'https://www.youtube.com/watch?v=qZN2jt2cCU4', '36-Can-Climate-Models-Predict-Climate-Change_.mp4', '36-Can-Climate-Models-Predict-Climate-Change_.mp4', 'conservative', 'fact', 'Complex', 'Medium'),
(74, 'Fireside Chat Ep. 70 – Women, Socialism and Climate Change', 'In his latest Fireside Chat, Dennis Prager discusses women in the workforce, socialism, and why you shouldn\'t listen to climate change alarmists. Check it out!', 'audio', 'https://www.podchaser.com/podcasts/fireside-chat-with-dennis-prag-809333/episodes/fireside-chat-ep-70-women-soci-37308980', 'j1JtVIjGVBoh.128.mp3', 'j1JtVIjGVBoh.128.mp3', 'conservative', 'opinion', 'Simple', 'Medium'),
(75, 'Tucker: Democrats, fires and the climate misinformation campaign', '15 min (FOX) report forrest fires allegedly caused by climate change, are actually caused by mismanagement (many personal attacks on politicians included)', 'video', 'https://www.youtube.com/watch?v=DRSp_uhRhM4', '10-Tucker_Democrats-fires-and-the-climate-misinformation-campaign.mp4', '10-Tucker_Democrats-fires-and-the-climate-misinformation-campaign.mp4', 'conservative', 'belief', 'Medium', 'Medium'),
(76, 'Science Friday - Under A Mile Of Ice, A Climate Clue', 'Scientists studying sediment taken from a core sample of the Greenland ice sheet just 800 miles from the North Pole have found remnants of ancient plants, freeze-dried under more than a mile of ice.', 'audio', 'https://www.sciencefriday.com/segments/greenland-twigs-ice/', 'greenland-twigs-ice.mp3', 'greenland-twigs-ice.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(77, 'Global Warming: Review on Driving Forces and Mitigation', 'Global warming is one of the major consequences of thehuman activities where the overuse of fossil fuels as energyresources caused the increase in the concentration of thegreenhouse gases (GHGs), such as CO2,CH4,N2O, and watervapor, in the atmosphere causing the increase in the averagesurface temperature of the earth', 'text', 'https://aiche.onlinelibrary.wiley.com/doi/epdf/10.1002/ep.13041', '36_CM_Review_on_driving_forces_and_mitigation.pdf', '36_CM_Review_on_driving_forces_and_mitigation.pdf', 'progressive', 'fact', 'Complex', 'Medium'),
(78, 'Consensus on consensus: a synthesis of\r\nconsensus estimates on human-caused global\r\nwarming', 'The consensus that humans are causing recent global warming is shared by 90%–100% of publishing climate scientists according to six independent studies by co-authors of this paper. Those results are consistent with the 97% consensus reported by Cook et al (Environ. Res. Lett. 8 024024) based on 11 944 abstracts of research papers, of which 4014 took a position on the cause of recent global warming.', 'text', 'https://iopscience.iop.org/article/10.1088/1748-9326/11/4/048002/pdf', '37_CM_a_synthesis_of_consensus.pdf', '37_CM_a_synthesis_of_consensus.pdf', 'progressive', 'opinion', 'Complex', 'Medium'),
(79, '39 Ways to Save the Planet - Steel without the fossil fuels', 'Steel-making is the biggest industrial emitter of carbon dioxide. Meet the Swedes who\'ve found a way to produce steel without harming the planet.', 'audio', 'https://www.bbc.co.uk/programmes/m000v9tl', '39WaysToSaveThePlanet-20210423-SteelWithoutTheFossilFuels.mp3', '39WaysToSaveThePlanet-20210423-SteelWithoutTheFossilFuels.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(80, '39 Ways to Save the Planet - Cutting the Cow Burps', 'Cattle emit huge quantities of planet-warming methane. But they can be stopped! Meet the researchers with a host of cunning ideas.', 'audio', 'https://www.bbc.co.uk/programmes/m000vh54', '39WaysToSaveThePlanet-20210428-CuttingTheCowBurps.mp3', '39WaysToSaveThePlanet-20210428-CuttingTheCowBurps.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(81, '39 Ways to Save the Planet - Zero Carbon Farm', 'Can British farmers transform themselves into carbon-cutting heroes. Tom Heap meets arable farmer Duncan Farrington, who has turned his farm into a carbon dioxide absorbing marvel.', 'audio', 'https://www.bbc.co.uk/programmes/m000vjnp', '39WaysToSaveThePlanet-20210430-ZeroCarbonFarm.mp3', '39WaysToSaveThePlanet-20210430-ZeroCarbonFarm.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(82, 'Science Friday - Eating Smarter In A Warming World', 'A quarter of the world’s greenhouse gas emissions come from putting food on the table. From the fossil fuels used to produce fertilizers, to the methane burps of cows, to the jet fuel used to deliver your fresh asparagus, eating is one of the most planet-warming things we do.', 'audio', 'https://www.sciencefriday.com/segments/eating-smarter-in-a-warming-world/', 'scifri201907122.mp3', 'scifri201907122.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(83, 'Climate Refugees: Nations under threat', '8 min (CBS) report on the island group of Kiribati and the effects climate change has on their life', 'video', 'https://www.youtube.com/watch?v=4MXoUbsswHY', '3-Climate-Refugees-Nations-under-threat_720p.mp4', '3-Climate-Refugees-Nations-under-threat_720p.mp4', 'progressive', 'belief', 'Medium', 'Medium'),
(84, 'Presumed Effects of “Fake News” on the Global Warming Discussion in a Cross-Cultural Context', '“Fake news” on global warming is widely disseminated via social and partisan media. Scientists worry about its effect, because fake news may hurt public support and change policy on climate change. The current study tested the roles of cultural constructs (individualism, collectivism, and uncertainty-avoidance) in predicting the presumed effect of fake news on global warming', 'text', 'https://www.mdpi.com/2071-1050/12/5/2123', '40_CM_fake_news.pdf', '40_CM_fake_news.pdf', 'center', 'fact', 'Complex', 'Medium'),
(85, 'Why renewables can’t save the planet | Michael Shellenberger | TEDxDanubia', '17 min (TED) lecture on the difficulties of generating renewable energies (related to wild life and efficiency), argument for nuclear energy', 'video', 'https://www.youtube.com/watch?v=N-yALPEpV4w', '17-Why-renewables-cant-save-the-planet-Michael-Shellenberger-TEDxDanubia.mp4', '17-Why-renewables-cant-save-the-planet-Michael-Shellenberger-TEDxDanubia.mp4', 'center', 'fact', 'Complex', 'Medium'),
(86, 'Explainer: Will global warming ‘stop’ as soon as net-zero emissions are reached?', 'Contrary to media portrayal, the scientific community has largely debunked the fact that the world is facing \'committed warming\' in the future as a result of past emissions. This means that the choices humans make today have the power to change their climate future.', 'text', 'https://www.eco-business.com/news/explainer-will-global-warming-stop-as-soon-as-net-zero-emissions-are-reached/', '13_SC_global_warming_and_net-zero_emissions.pdf', '13_SC_global_warming_and_net-zero_emissions.pdf', 'center', 'fact', 'Simple', 'Complex'),
(87, 'Conversation with global warming skeptic Anthony Watts', '9 min (PBS) interview with a metereologist who is a global warming skeptic', 'video', 'https://www.youtube.com/watch?v=UmIJCGQzCiU', '23-Conversation-with-global-warming-skeptic-Anthon-Watts.mp4', '23-Conversation-with-global-warming-skeptic-Anthon-Watts.mp4', 'conservative', 'fact', 'Complex', 'Medium'),
(88, 'Global Warming: Fact or Fiction? Featuring Physicists Willie Soon and Elliott D. Bloom', '108 min lecture on the status quo of the climate change debate and why it should be questioned', 'video', 'https://www.youtube.com/watch?v=1zrejG-WI3U', '34-Global-Warming_Fact-or-Fiction_Featuring-Physicists-Willie-Soon-and-Elliott-D-Bloom.mp4', '34-Global-Warming_Fact-or-Fiction_Featuring-Physicists-Willie-Soon-and-Elliott-D-Bloom.mp4', 'conservative', 'fact', 'Complex', 'Medium'),
(89, 'The Michael Knowles Show - Democrats’ Climate Catastrophe', 'The Democratic presidential candidates face off in a 7-hour long town hall on climate change.', 'audio', 'https://www.podchaser.com/podcasts/the-michael-knowles-show-541277/episodes/democrats-climate-catastrophe-44442216', 'WWO3740441620.mp3', 'WWO3740441620.mp3', 'conservative', 'opinion', 'Simple', 'Medium'),
(90, 'Firside Chat Ep. 102 –Climate Change Is Not an Existential Threat', 'During this week’s Fireside Chat, Dennis addresses the not-so-existential threat to our globe: Climate Change. Adults need to stop scaring children into thinking the world is going to end.', 'audio', 'https://www.podchaser.com/podcasts/fireside-chat-with-dennis-prag-809333/episodes/firside-chat-ep-102-climate-ch-45927447', 'qZsRrCndE1zs.128.mp3', 'qZsRrCndE1zs.128.mp3', 'conservative', 'opinion', 'Simple', 'Medium'),
(91, 'Green New Deal: Last Week Tonight with John Oliver (HBO)', '19 min (HBO) report on the potential effects of the green new deal and the public debate', 'video', 'https://www.youtube.com/watch?v=JDcro7dPqpA', '33-Green-New-Deal-Last-Week-Tonight-with-John-Oliver-HBO.mp4', '33-Green-New-Deal-Last-Week-Tonight-with-John-Oliver-HBO.mp4', 'progressive', 'fact', 'Medium', 'Medium'),
(92, 'Reducing the forest footprint of Chinese soft-commodity financing', 'A new study ranks China second in financing commodities linked to tropical deforestation risk. Its financial institutions could do more before state regulations are perfected.', 'text', 'https://www.eco-business.com/opinion/reducing-the-forest-footprint-of-chinese-soft-commodity-financing/', '11_SC_forest_footprint_of_Chinese_financing.pdf', '11_SC_forest_footprint_of_Chinese_financing.pdf', 'progressive', 'opinion', 'Simple', 'Complex'),
(93, 'How Amazon deforestation could push the climate to a \'tipping point\'', '9 min (PBS) report on deforestation in the Brazilian Amazon due to agriculture and effects on climate', 'video', 'https://www.youtube.com/watch?v=2yMnMJWyY7k', '35-How-Amazon-deforestation-could-push-the-climate-to-a-tipping-point.mp4', '35-How-Amazon-deforestation-could-push-the-climate-to-a-tipping-point.mp4', 'progressive', 'fact', 'Medium', 'Medium'),
(94, 'Climate 101: Deforestation | National Geographic', '3 min (NatGeo) animation on large scale deforestation across the globe, causes and effects', 'video', 'https://www.youtube.com/watch?v=Ic-J6hcSKa8', '27-Climate-101-Deforestation-National-Geographic.mp4', '27-Climate-101-Deforestation-National-Geographic.mp4', 'progressive', 'fact', 'Simple', 'Medium'),
(95, 'How Africa is affected by climate change | DW News', '12 min (DW) report on the impact of climate change on the african content, focussing on affected peoples', 'video', 'https://www.youtube.com/watch?v=8P1WG43VvgU', '22-How-Africa-is-affected-by-climate-change-DW-News.mp4', '22-How-Africa-is-affected-by-climate-change-DW-News.mp4', 'progressive', 'fact/belief', 'Simple', 'Medium'),
(96, 'Who Is Responsible For Climate Change? – Who Needs To Fix It?', '10 min animation discussing the question of which countries should take responsibility for fixing climate change', 'video', 'https://www.youtube.com/watch?v=ipVxxxqwBQw', '37-Who-Is-Responsible-For-Climate-Change-Who-Needs-To-Fix-It.mp4', '37-Who-Is-Responsible-For-Climate-Change-Who-Needs-To-Fix-It.mp4', 'progressive', 'fact', 'Simple', 'Medium'),
(97, 'Green finance will help put the brakes on climate change, but Asian companies risk missing out', 'More money is flowing into green, sustainable finance. But Asian companies are behind the curve in terms of receiving it, according to a panel during the CNA Leadership summit. Better governance is needed.', 'text', 'https://www.eco-business.com/news/green-finance-will-help-put-the-brakes-on-climate-change-but-asian-companies-risk-missing-out/', '12_SC_Green_finance_will_help.pdf', '12_SC_Green_finance_will_help.pdf', 'progressive', 'fact', 'Simple', 'Complex'),
(98, 'The state of the climate crisis | Climate Action Tracker', '5 min (TED) animated video on predicted temperature rise and the actions countries take to reduce their emissions', 'video', 'https://www.youtube.com/watch?v=k1oPVp63eNk', '2-The-state-of-the-climate-crisis-Climate-Action-Tracker.mp4', '2-The-state-of-the-climate-crisis-Climate-Action-Tracker.mp4', 'progressive', 'fact', 'Complex', 'Medium'),
(99, 'Energy Transition: No rush for India on net zero', 'One is bombarded with information these days on why India should join the net-zero or carbon-neutral coalition of countries, implying that, by 2050, the net carbon emissions of these countries would be balanced by carbon sequestration and removal to the same extent, thus contributing net-zero carbon to the environment.', 'text', 'https://www.financialexpress.com/opinion/energy-transition-no-rush-for-india-on-net-zero/2250247/', '14_SC_Energy_Transition_India.pdf', '14_SC_Energy_Transition_India.pdf', 'center', 'opinion', 'Simple', 'Complex'),
(100, 'The Future of the Carbon Cycle in a Changing Climate', 'Surface and space-based observations, field experiments, and models all contribute to our evolving understanding of the ways that Earth’s many systems absorb and release carbon.', 'text', 'https://eos.org/features/the-future-of-the-carbon-cycle-in-a-changing-climate', '26_MC_The_Future_of_the_Carbon_Cycle.pdf', '26_MC_The_Future_of_the_Carbon_Cycle.pdf', 'center', 'fact', 'Medium', 'Complex'),
(101, 'The Maths of Climate Change', '59 min lecture on the mathematics behind the models that try to predict climate change', 'video', 'https://www.youtube.com/watch?v=w4O4jK-lZrI', '18-The-Maths-of-Climate-Change.mp4', '18-The-Maths-of-Climate-Change.mp4', 'center', 'fact', 'Complex', 'Complex'),
(102, 'Scientists urge US to fund geoengineering research while admitting climate intervention is “dumb and risky”', 'The United States should pursue research into solar geoengineering to cool Earth even if climate intervention carries a lot of risks. This is according to a statement made by the National Academies of Sciences, Engineering and Medicine (NASEM) said on March 25.', 'text', 'https://climate.news/2021-04-05-scientists-urge-fund-geoengineering-research-despite-risks.html', '15_SC_admitting_climate_intervention.pdf', '15_SC_admitting_climate_intervention.pdf', 'conservative', 'fact', 'Simple', 'Complex'),
(103, 'Population Control Isn\'t the Answer to Climate Change. Capitalism Is.', '13 min video essay critical about the problem of overpopulation, arguing that it can be solved by improving food production technologies', 'video', 'https://www.youtube.com/watch?v=4xkXjj6dalM', '42-Population-Control-Isnt-the-Answer-to-Climate-Change-Capitalism-Is.mp4', '42-Population-Control-Isnt-the-Answer-to-Climate-Change-Capitalism-Is.mp4', 'conservative', 'belief', 'Complex', 'Medium'),
(104, 'Cows and Climate - Introduction', '5 min video essay that tries to pu the contribution of lifestock to greenhouse gasses in perspective', 'video', 'https://www.youtube.com/watch?v=PR7ATkTXSb8', '31Cows-and-Climate-Introduction.mp4', '31Cows-and-Climate-Introduction.mp4', 'conservative', 'fact', 'Simple', 'Medium'),
(105, 'Eating less Meat won\'t save the Planet. Here\'s Why', '24 min video essay on why the effects of meat consumption on climate change are overestimated', 'video', 'https://www.youtube.com/watch?v=sGG-A80Tl5g', '5-Eating-less-Meat-wont-save-the-Planet-Heres-Why.mp4', '5-Eating-less-Meat-wont-save-the-Planet-Heres-Why.mp4', 'conservative', 'fact', 'Simple', 'Medium'),
(106, 'Reframing the Language of Retreat', 'With so many communities facing relocation from a changing climate, reframing “managed retreat” is needed to respect people’s self-determination.', 'text', 'https://eos.org/opinions/reframing-the-language-of-retreat', '27_MC_Reframing_the_Language_of_Retreat.pdf', '27_MC_Reframing_the_Language_of_Retreat.pdf', 'progressive', 'opinion', 'Medium', 'Complex'),
(107, 'Study finds six degrees celsius cooling on land during the last Ice Age', 'Researchers show that prior studies have underestimated the cooling in the last glacial period, which has low-balled estimates of the Earth\'s climate sensitivity to greenhouse gases. The rather high climate sensitivity is not good news regarding future global warming, which may be stronger than expected using previous best estimates.', 'text', 'https://www.sciencedaily.com/releases/2021/05/210512143600.htm', '30_MC_implications_about_future_global_warming.pdf', '30_MC_implications_about_future_global_warming.pdf', 'progressive', 'fact', 'Medium', 'Complex');
INSERT INTO `resources_extended` (`id`, `title`, `copy`, `type`, `link_web`, `path`, `uuid`, `political`, `belief`, `form`, `content`) VALUES
(108, 'Land-use emissions play a critical role in land-based mitigation for Paris climate target', 'Here we show that additional land-use change to meet a 1.5 °C climate change target could result in net losses of carbon from the land. The effectiveness of BECCS strongly depends on several assumptions related to the choice of biomass, the fate of initial above ground biomass, and the fossil-fuel emissions offset in the energy system', 'text', 'https://www.nature.com/articles/s41467-018-05340-z.pdf?origin=ppub', '44_CC_Land-use_emissions.pdf', '44_CC_Land-use_emissions.pdf', 'progressive', 'fact', 'Complex', 'Complex'),
(109, 'Hot Take: Yes, It\'s Still Time to Talk About Climate', 'Amid nationwide Black Lives Matter protests, some climate activists have been saying \"now\'s not the time to talk about climate.\" In this episode we talk about how justice is justice, climate and racial justice are all the same thing, they can\'t be separated.', 'audio', 'https://www.stitcher.com/show/hot-take-4/episode/yes-its-still-time-to-talk-about-climate-70208191', 'hot-take-yes-its-still-time-to-talk-about-climate.mp3', 'hot-take-yes-its-still-time-to-talk-about-climate.mp3', 'progressive', 'mix', 'Medium', 'Complex'),
(110, 'Big Brains - Doomsday Clock’s ‘historic wake-up call,’ with Rachel Bronson', 'This year the Doomsday Clock has been set at 100 seconds to midnight—as close to total destruction as we were in 2020. But after a year of increasingly dangerous weather and wildfires, not to mention the COVID-19 pandemic, why didn’t the clock move?', 'audio', 'https://news.uchicago.edu/big-brains-podcast-doomsdays-clocks-historic-wake-call', 'Big-Brains-Doomsday-Clocks-historic-wake-up-call-with-Rachel-Bronson.mp3', 'Big-Brains-Doomsday-Clocks-historic-wake-up-call-with-Rachel-Bronson.mp3', 'progressive', 'fact', 'Medium', 'Complex'),
(111, 'Science Friday - Why We Need To Talk About Microbes And Climate', 'We may refer to Earth as “our planet,” but it really belongs to the microbes. All the plants and animals on Earth are relatively new additions to the planetary ecosystem. But despite living basically everywhere on the planet, and playing a role in many of the processes that affect the climate, the connection between microbes and the climate is often ignored.', 'audio', 'https://www.sciencefriday.com/segments/why-we-need-to-talk-about-microbes-and-climate/', 'why-we-need-to-talk-about-microbes-and-climate.mp3', 'why-we-need-to-talk-about-microbes-and-climate.mp3', 'progressive', 'fact', 'Simple', 'Complex'),
(112, 'Science Friday - How The Past Hints About Our Climate’s Future', 'Ask a climate scientist how much the earth will warm as a result of the carbon dioxide we’re emitting conservative now, and the answer will be a range of temperatures: likely anywhere from 1 to 5 degrees Celsius.', 'audio', 'https://www.sciencefriday.com/segments/geologic-past-climate-future/', 'geologic-past-climate-future.mp3', 'geologic-past-climate-future.mp3', 'progressive', 'fact', 'Simple', 'Complex'),
(113, 'Science Friday - A New President, A New Climate Policy', 'When President Biden was running for office, he campaigned on re-entering the Paris climate accords his first day in the White House. He followed through shortly after being sworn in.', 'audio', 'https://www.sciencefriday.com/segments/biden-climate-policy/', 'biden-climate-policy.mp3', 'biden-climate-policy.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(114, 'Water Limitations in the Tropics Offset Carbon Uptake from Arctic Greening', 'More plants and longer growing seasons in the northern latitudes have converted parts of Alaska, Canada and Siberia to deeper shades of green. Some studies translate this Arctic greening to a greater global carbon uptake.', 'text', 'https://climate.nasa.gov/news/3055/water-limitations-in-the-tropics-offset-carbon-uptake-from-arctic-greening/', '29_MC_Carbon_Uptake_from_Arctic_Greening.pdf', '29_MC_Carbon_Uptake_from_Arctic_Greening.pdf', 'center', 'fact', 'Medium', 'Complex'),
(115, 'A decline in emissions of CFC-11 and related \r\nchemicals from eastern China', 'Emissions of ozone-depleting substances, including trichlorofuoromethane, have decreased since the mid-1980s in response to the Montreal Protocol.', 'text', 'https://www.nature.com/articles/s41586-021-03277-w.pdf', '41_CC_decline_in_emissions.pdf', '41_CC_decline_in_emissions.pdf', 'center', 'fact', 'Complex', 'Complex'),
(116, 'What is better for mitigating carbon emissions – Renewable energy or nuclear energy? A panel data analysis', 'This paper investigates the determinants of carbon emissions based on energy consumption, analyzing the data of 30 countries using nuclear energy for the period 1990–2014.', 'text', 'https://www.sciencedirect.com/science/article/pii/S1364032118302326', '42_CC_Renewable_and_Sustainable_Energy.pdf', '42_CC_Renewable_and_Sustainable_Energy.pdf', 'center', 'fact', 'Complex', 'Complex'),
(117, 'Federalist - Physics Reveals \'Green\' Energy Sources Are Unrealistic And Unsustainable', 'Can existing \"green\" energy match the efficiency of fossil fuels? Mark P. Mills is a senior fellow at the Manhattan Institute, whose new report examines the physics behind green energy proposals, and shows why the world is no where near ready to undergo this \"urgent\" transition demanded by climate change alarmists.', 'audio', 'https://www.podchaser.com/podcasts/the-federalist-radio-hour-155339/episodes/physics-reveals-green-energy-s-38248232', 'Fed190329_azhq_aef771f9.mp3_025c1df78b57575b0f02adb28a3bb427_20059814.mp3', 'Fed190329_azhq_aef771f9.mp3_025c1df78b57575b0f02adb28a3bb427_20059814.mp3', 'conservative', 'fact', 'Complex', 'Complex'),
(118, 'World In Midst of Carbon Drought (w/ Prof. William Happer, Princeton University)', '23 min interview with physics professor explaining the upside of having higher concentrations of CO2 in the atmosphere', 'video', 'https://www.youtube.com/watch?v=U-9UlF8hkhs', '26-World-In-Midst-of-Carbon-Drought-(w_Prof-William-Happer-Princeton-University).mp4', '26-World-In-Midst-of-Carbon-Drought-(w_Prof-William-Happer-Princeton-University).mp4', 'conservative', 'fact', 'Medium', 'Medium'),
(119, 'Climate change hoax COLLAPSES as new science finds human activity has virtually zero impact on global temperatures', 'The climate change hoax has collapsed. A devastating series of research papers has just been published, revealing that human activity can account for no more than a .01°C rise in global temperatures.', 'text', 'https://www.climatesciencenews.com/2019-07-12-climate-change-hoax-collapses-new-science-cloud-cover.html', '28_MC_Climate_change_hoax_COLLAPSES.pdf', '28_MC_Climate_change_hoax_COLLAPSES.pdf', 'conservative', 'fact', 'Medium', 'Complex'),
(120, 'Federalist - Michael Shellenberger: Climate Alarmism Is Misleading And Immoral', 'Bestselling author, journalist, and environmental activist Michael Shellenberger joined host Ben Domenech to discuss climate alarmism and how the progressive wing media and activists have distorted the urgency of climate change.', 'audio', 'https://www.podchaser.com/podcasts/federalist-radio-hour-155339/episodes/michael-shellenberger-climate-70587926', 'Fed_200709Shellenberger_FINAL.mp3', 'Fed_200709Shellenberger_FINAL.mp3', 'conservative', 'fact', 'Complex', 'Complex'),
(121, 'As global temperatures rise, humans at risk from weather extremes', '8 min (CBS) interview about the possible risks of extreme weather that come with global temperature rise', 'video', 'https://www.youtube.com/watch?v=kTKa2KldglM', '9-As-global-temperatures-rise-humans-at-risk-from-weather-extremes.mp4', '9-As-global-temperatures-rise-humans-at-risk-from-weather-extremes.mp4', 'progressive', 'fact', 'Complex', 'Complex'),
(122, '‘Climate Change: Science and Policy’ Lecture by Mario Molina, Nobel Prize in Chemistry', '78 min lecture on climate change and sustainable developments from a chemistry point of view', 'video', 'https://www.youtube.com/watch?v=U_bXzc6hfGM', '21-Climate-Change_Science-and-Policy-Lecture-by-Mario-Molina-Nobel-Prize-in-Chemistry.mp4', '21-Climate-Change_Science-and-Policy-Lecture-by-Mario-Molina-Nobel-Prize-in-Chemistry.mp4', 'progressive', 'fact', 'Complex', 'Complex'),
(123, 'Explainer: Climate refugees a focus at UN talks', '2 min (Al Jazeera) report on future climate refugees', 'video', 'https://www.youtube.com/watch?v=gmmQjuZzFcc', '20-Explainer_Climate-refugees-a-focus-at-UN-talks.mp4', '20-Explainer_Climate-refugees-a-focus-at-UN-talks.mp4', 'progressive', 'belief', 'Medium', 'Complex'),
(124, 'How could veganism change the world? | The Economist', '6 min (Economist) video essay on the effects of a plant based diet on the environment', 'video', 'https://www.youtube.com/watch?v=hwoL6hWd4l0', '12-How-could-veganism-change-the-world-The-Economist.mp4', '12-How-could-veganism-change-the-world-The-Economist.mp4', 'progressive', 'fact', 'Medium', 'Complex'),
(125, 'Why Meat is the Best Worst Thing in the World ', '8 min animation on why meat is not an effective way to feed humans', 'video', 'https://www.youtube.com/watch?v=NxvQPzrg2Wg', '25-Why-Meat-is-the-Best-Worst-Thing-in-the-World.mp4', '25-Why-Meat-is-the-Best-Worst-Thing-in-the-World.mp4', 'progressive', 'fact', 'Simple', 'Complex'),
(126, 'Climate Change: What Happens If The World Warms Up By 4°C?', '2 min (skynews) animation about the possible effects of a temperature rise of 4 degrees celsius', 'video', 'https://www.youtube.com/watch?v=HqgbR3UK0es', '8-Climate-Change_What-Happens-If-The-World-Warms-Up-By-4C_.mp4', '8-Climate-Change_What-Happens-If-The-World-Warms-Up-By-4C_.mp4', 'progressive', 'fact/belief', 'Simple', 'Complex'),
(127, 'Science Friday - How The Fashion Industry Is Responding To Climate Change', 'If there’s one industry out there that knows something about trends, it’s the fashion industry. Long known for churning out cheap garments and burning through resources, some fashion labels like fast fashion giant H&M are now embracing sustainable fashion trends.', 'audio', 'https://www.sciencefriday.com/segments/doc-climate-and-fashion/', 'doc-climate-and-fashion.mp3', 'doc-climate-and-fashion.mp3', 'progressive', 'fact', 'Simple', 'Medium'),
(128, 'Science Friday - The Climate Is Changing—But Can We?', 'Beyond the graphs and figures, how do you get people to actually take action? And are small changes in behavior enough—or is a reshaping of society needed to deal with the climate crisis', 'audio', 'https://www.sciencefriday.com/segments/changing-climate-behaviors/#segment-transcript', 'changing-climate-behaviors.mp3', 'changing-climate-behaviors.mp3', 'progressive', 'fact', 'Medium', 'Medium'),
(129, 'Climate I: Is The Debate Over?', '52 min in depth debate between two climate change scientists (a skeptic and a supporter)', 'video', 'https://www.youtube.com/watch?v=gJwayalLpYY', '15-Climate-I-Is-The-Debate-Over_360p.mp4', '15-Climate-I-Is-The-Debate-Over_360p.mp4', 'center', 'fact', 'Complex', 'Complex'),
(130, 'Climate change: the trouble with trees | The Economist', '10 min (economist) video essay that explores the problems of monoculture tree plantations', 'video', 'https://www.youtube.com/watch?v=EXkbdELr4EQ', '30-Climate-change-the-trouble-with-trees-The-Economist.mp4', '30-Climate-change-the-trouble-with-trees-The-Economist.mp4', 'center', 'fact', 'Medium', 'Complex'),
(131, 'Is It Too Late To Stop Climate Change? Well, it\'s Complicated.', '10 min long animated video on possible ways to address climate change', 'video', 'https://www.youtube.com/watch?v=wbR-5mHI6bo', '1-Is-It-Too-Late-To-Stop-Climate-Change-Well-its-Complicated.mp4', '1-Is-It-Too-Late-To-Stop-Climate-Change-Well-its-Complicated.mp4', 'center', 'fact', 'Simple', 'Complex'),
(132, 'Exploiting Climate Change for Power & Twitter\'s Fact Police Are Here | DIRECT MESSAGE', 'Dave Rubin of The Rubin Report talks about Chuck Schumer wanting to use climate change to give Joe Biden emergency power, Biden’s vaccine rollout plan, Gavin Newsom deciding to end lockdown conservative as the recall Gavin Newsom movement grows, and Twitter announcing “Birdwatch” a new big tech ministry of truth.', 'audio', 'https://player.fm/series/the-rubin-report-2407914/exploiting-climate-change-for-power-twitters-fact-police-are-here-direct-message', 'Exploiting_Climate_Change_for_Power_&_Twitters_Fact_Police_Are_Here_DIRECT_MESSAGE.mp3', 'Exploiting_Climate_Change_for_Power_&_Twitters_Fact_Police_Are_Here_DIRECT_MESSAGE.mp3', 'conservative', 'opinion', 'Medium', 'Medium'),
(133, 'The Truth Podcast: Question Everything - Climate Change: The Biggest Hoax Ever', 'In the absence of any real science to support the outrageous claims, it was propaganda initiatives combined with never-ending Fake News stories, that brought nearly 50% of the American public to now believe in at least some degree of man-made \"Climate Change\".', 'audio', 'https://www.bullhorn.fm/thetruthpodcastquestioneveryth/posts/climate-change-the', 'Climate-Change-The-Biggest-Hoax-Ever.mp3', 'Climate-Change-The-Biggest-Hoax-Ever.mp3', 'conservative', 'opinion', 'Simple', 'Medium'),
(134, 'Livestock and climate, Professor Frank Mitloehner, University of California, Davis.', '44 min lecture on the impact of lifestock and agriculture on climate change', 'video', 'https://www.youtube.com/watch?v=hdm_UHISFgs', '32-Livestock-and-climate-Professor-Frank-Mitloehner-University-of-California-Davis.mp4', '32-Livestock-and-climate-Professor-Frank-Mitloehner-University-of-California-Davis.mp4', 'conservative', 'fact', 'Complex', 'Complex'),
(135, 'Bjorn Lomborg | Don\'t waste trillions on BAD Climate Policy', '81 min lecture on the impact of climate change policies', 'video', 'https://www.youtube.com/watch?v=otsJno55J0g', '16-Bjorn-Lomborg-Dont-waste-trillions-on-BAD-Climate-Policy.mp4', '16-Bjorn-Lomborg-Dont-waste-trillions-on-BAD-Climate-Policy.mp4', 'conservative', 'fact', 'Medium', 'Complex');
